function MoreDetailsMob() {
  return (
    <div className="md-mob">
      <img
        src="../images/choise_address/close.svg"
        className="md-mob__button"
      />
      <span className="md-mob__title">Товары заказа</span>
      <div className="md-mob__cart">
        <div className="md-mob__cart__row">
          <span className="md-mob__cart__number">1</span>
          <div className="md-mob__cart__img"></div>
        </div>
      </div>
    </div>
  );
}

export default MoreDetailsMob;
